import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

const Employees = () => {
  return (
    <div className='container-sm mt-5'>
      <h1>Dolgozók</h1>
      <NavLink
        className='navbar-item nav-link active'
        exact
        to='/newEmployee'
        activeClassName='activeClicked'
      >
        <button type='button' class='btn btn-dark mt-5'>
          Létrehozás
        </button>{' '}
      </NavLink>

      <div className='container-sm mt-5'>
        <select
          className='form-select mt-5'
          aria-label='Default select example'
        >
          <option selected>Válassz dolgozót</option>
          {departments.map(department => (
            <option key={department} value={department}>
              {department}
            </option>
          ))}
        </select>
      </div>

      <div className='container-sm mt-5'>
        <button type='button' class='btn btn-warning mt-5'>
          Módosítás
        </button>{' '}
        <button type='button' class='btn btn-danger mt-5'>
          Törlés
        </button>{' '}
      </div>
    </div>
  );
};

export default Employees;
